var $ = jQuery;

// format prices
$(function($) {
	$('.price').number( true, 0 ); // Changes the text value of the element matching selector to the formatted number.
});

// Sticky Nav
$(window).scroll(function() {    
    var scroll = $(window).scrollTop();

    if (scroll >= 100) {
        $("#page").addClass("sticky");
    } else {
		$("#page").removeClass("sticky");
    }
});

// menu click
$(function($) {
  $('.menu-toggle').click(function(e) {
    $('body').toggleClass('disablescroll');
  });
});


// Slick
$(function() {
	$('.slick').slick({
		dots: false,
		infinite: true,
		slidesToShow: 1,
		slidesToScroll: 1,
		autoplay: true,
  		autoplaySpeed: 7000,
		speed: 500,
		fade: true,
		cssEase: 'linear',
	});
});

// close popup
$(function() {
	$('.close_popup').click(function(e){
		e.preventDefault();
		$('.map_popup').removeClass('show');
		$("#map_popups").removeClass('show');
	});
});

// Youtube popup Link
$(function() {
	$('.youtube a').on('click', function(event) {
		event.preventDefault();
		var target = $(this).attr('href');
		$(target).toggleClass('show');
	});
});

// view360 popup Link
$(function() {
	$('.view360 a').on('click', function(event) {
		event.preventDefault();
		var target = $(this).attr('href');
		$(target).toggleClass('show');
	});
});

// tabs
$(function () {
	$('.tabs').on('click', '.tab-link', function(event) {
		tabTarget = $(this).attr('href');
		console.log(tabTarget);

		if (!$(this).hasClass('is-active')) {
			event.preventDefault();
			$('.tab-link').removeClass('is-active');
			$('.tab-content').removeClass('is-active');
			$(this).addClass('is-active');
			$(tabTarget).addClass('is-active');
		} else {
			event.preventDefault();
		}
	});
});

// tabs
$(function () {
	$('.spec-tabs').on('click', '.spec-tab-link', function(event) {
		tabTarget = $(this).attr('href');
		console.log(tabTarget);

		if (!$(this).hasClass('is-active')) {
			event.preventDefault();
			$('.spec-tab-link').removeClass('is-active');
			$('.spec-tab-content').removeClass('is-active');
			$(this).addClass('is-active');
			$(tabTarget).addClass('is-active');
		} else {
			event.preventDefault();
		}
	});
});

//plot info bubble 
$(function() {
	$('#plots li').hover(function(event) {
		$(this).toggleClass('show');
	});

});


